import axios from 'axios';
//import logo from './logo.svg';
import './App.css';

class App extends React.Component {
	constructor(props) {
		super(props);
		this.state = { apiResponse: "" };
	}

	callApi(){
		fetch("http://127.0.0.1:8080")
			.then(res => res.text())
			.then(res => this.setState( { apiResponse: res }));
}

 	componentDidMount() {
		this.callApi();   

 }

  render() {
    return (
	    <div className="App">
	    	<h1> Hello Arni </h1>
     	        <p>{this.state.apiResponse}</p>
	    </div>

    );
 }
}

export default App;
